import React from 'react'
import { Header } from 'semantic-ui-react'

const TeamDetails = () => {
  return (
    <div>
        <Header as={<h1/>} attached dividing textAlign='center'>
            Shadan's Team
        </Header>
    </div>
  )
}

export default TeamDetails
